import React, { useState } from 'react';

function Search() {
  const [rooms, setRooms] = useState([]);

  const handleSearch = () => {
    // Update the URL to match your server's address and endpoint
    fetch('http://localhost:3001/api/search')
      .then(response => response.json())
      .then(data => {
        setRooms(data);
      })
      .catch(error => console.error('Error fetching rooms:', error));
  };

  return (
    <div>
      <h2>Room Search</h2>
      <button onClick={handleSearch}>Search</button>
      <div>
        {rooms.map(room => (
          <div key={room.room_id}> {/* Ensure 'id' matches your room identifier */}
            <p>Room Name: {room.name}</p> {/* Adjust to match your room properties */}
            {/* Add more room details here */}
          </div>
        ))}
      </div>
    </div>
  );
}

export default Search;
